import React from 'react';
import './index.css';

function App(props) {
    return(
    <>
    <div className='cards'>
        <div className='card'>
            <img src={props.imagesrc} alt="my pic" className='img' />
            <div className='card_info'>
                <span className='card_catogories'>{props.title}</span>
                <h3 className='card_title'>{props.sname}</h3>
                <a href={props.link} target="_blank">
                    <button>Watch Now</button>
                </a>
            </div>
        </div>
    </div>
   </>
    )
}
export default App;
